result:
query {
  metadata {
    siteName
  }
  posts: allPost {
    edges {
      node {
        id
        title
        date (format: "D. MMMM YYYY")
        description
        cover_image (width: 770, height: 380, blur: 10)
        path
        tags {
          id
          title
          path
        }
      }
    }
  }
  tags:allTag{
    edges{
      node
      {
        id
        title
        path
      }
    }
  }
  newpost:allPost(sortBy:"date" ,order:DESC ,limit:3){
    edges{
      node{
        id
        title
        date(format: "D. MMMM YYYY")
        cover_image (width: 770, height: 380, blur: 10)
        path
      }
    }
  }
}
